import React from "react";
import ReactWordcloud from "react-wordcloud";
import "tippy.js/dist/tippy.css";
import "tippy.js/animations/scale.css";

function Worldcloud() {
  const words = [
    {
      text: "told",
      value: 1,
    },
    {
      text: "mistake",
      value: 2,
    },
    {
      text: "thought",
      value: 3,
    },
    {
      text: "bad",
      value: 17,
    },
  ];

  const size = [600, 400];

  const options = {
    colors: ["#ed1c24", "#9FD5D8", "#efabb8", "#ffcb78", "#9ec58c"],
    enableTooltip: true,
    deterministic: false,
    fontFamily: "lato",
    fontSizes: [20, 60],
    fontStyle: "normal",
    fontWeight: "normal",
    padding: 1,
    rotations: 3,
    rotationAngles: [0, 90],
    scale: "sqrt",
    spiral: "archimedean",
    transitionDuration: 1000,
  };

  return <ReactWordcloud options={options} size={size} words={words} />;
}

export default Worldcloud;
